import React from "react";
import { Navlink } from "react-router-dom";

const Navbar = () => {
    return(
        <>
            <nav className="mainMenu">
                <Navlink exact to="/" activeClassName="menu_link" className="menu_style"> Home </Navlink>
                <Navlink exact to="/about" activeClassName="menu_link" className="menu_style"> About </Navlink>
                <Navlink exact to="/contact" activeClassName="menu_link" className="menu_style"> Contact</Navlink>
            </nav>
        </>
    )
}

export default Navbar;
